

window.addEventListener('load', init);

// Globals
let difficulty = 'medium';
let rank = 0;

var players;

var socket = io.connect();

const difficulties = [
    "short",
    "medium",
    "long"
]
socket.on('connect',()=> {
  this.name = localStorage.getItem("name");
  console.log('socket on: ' + localStorage.getItem("name"));
  socket.emit('sendName', (this.name));
});

socket.on('gameReady', ()=> {
  console.log('gameReady received');
  startGame();
});

socket.on('sendDifficulty', (data) => {
  difficulty = data.difficulty;
  rank = data.rank;

})

socket.on('end', (data)=> {

  if (!data.win)
  {
    currentWord.innerHTML = "Game Over, " + data.name + "!";
  } else {
    currentWord.innerHTML = "You Win, " + data.name + "!";
  }

  //Displays Game Over screem
  wordInput.style.display = "none";
  message.style.display= "none";
  seconds.innerHTML = time.valueOf();
  wpmDisplay.innerHTML = data.wmp.valueOf();
  rankDisplay.innerHTML = rank.valueOf();
})

socket.on('leaderboard', (players)=> {
  players = players;
  firstRank.innerHTML = "1. " + players[0].name;
  secondRank.innerHTML = "2. " +players[1].name;
  thirdRank.innerHTML = "3. " +players[2].name;
  fourthRank.innerHTML =  "4. " +players[3].name;
})

